import React, { Component } from 'react';

class ProjectItem extends Component {

  deleteProject(id){
    this.props.onDelete(id);
  }

  render(){
    return(
      <li className="Projects">
        <strong>{this.props.project.title} :</strong> {this.props.project.category} <button className="btn btn-primary m" onClick={this.deleteProject.bind(this, this.props.project.id)}> Delete </button>
      </li>
    );
  }
}

export default ProjectItem;
